graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>API Service</b></font></td></tr><tr><td align="center"><font point-size="10">v1.0.0</font></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="environment__key" align="left" balign="left">environment</td><td port="environment__value" align="left" balign="left">production</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "config" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>config</b> <i>&lt;context&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="apiKey__key" align="left" balign="left">apiKey : string</td><td port="apiKey__value" align="left" balign="left">#envApiKey</td></tr><tr><td port="timeout__key" align="left" balign="left">timeout : Duration</td><td port="timeout__value" align="left" balign="left">PT30S</td></tr></table></td></tr></table>>, pad=0.5, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C", URL="#L6:0-9:2"];
  "authenticate" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>authenticate</b> <i>&lt;task&gt;</i> <i>@Critical</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="provider__key" align="left" balign="left">provider</td><td port="provider__value" align="left" balign="left">OAuth2</td></tr></table></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", penwidth=3, URL="#L11:0-13:2"];
  "fetchData" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>fetchData</b> <i>&lt;task&gt;</i> <i>@Async</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="endpoint__key" align="left" balign="left">endpoint : URL</td><td port="endpoint__value" align="left" balign="left">https://api.example.com</td></tr></table></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L15:0-17:2"];
  "Start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Start</b></td></tr></table>>, pad=0.5, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "End" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>End</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "Start" -> "authenticate" [labelOverlay="75%", edgeURL="#L19:6-19:21"];
  "authenticate" -> "fetchData" [style="dashed", labelOverlay="75%", edgeURL="#L19:22-19:35"];
  "fetchData" -> "End" [labelOverlay="75%", edgeURL="#L19:36-19:42"];
}
